when HTTP_REQUEST {
    if { [ACCESS::session exists] } {
        set sessionID [ACCESS::session sid]
        set user [ACCESS::session data get "session.logon.last.username"]
        HTTP::header insert "X-Authenticated-User" $user
    }
}
